import Link from "next/link";
import Typography from "@material-ui/core/Typography";

export default function Sections() {
  return (
    <React.Fragment>
      <Typography variant="h5" style={{ textAlign: "center" }}>
        Featured Flowers & Gifts
      </Typography>

      <div className="sectionsWrapper">
        <Link href="/sale">
          <a className="item">
            <img src="/sale.webp" alt="sale" />
            <Typography variant="h6" className="link">
              Sale
            </Typography>
          </a>
        </Link>
        <Link href="/sympathy">
          <a className="item">
            <img src="/sympathy.webp" alt="sympathy" />
            <Typography variant="h6" className="link">
              Sympathy
            </Typography>
          </a>
        </Link>
        <Link href="/gifts">
          <a className="item">
            <img src="/gifts.jpg" alt="gifts" />
            <Typography variant="h6" className="link">
              Gifts
            </Typography>
          </a>
        </Link>
        <Link href="/plants">
          <a className="item">
            <img src="/plants.jpg" alt="plants" />
            <Typography variant="h6" className="link">
              Plants
            </Typography>
          </a>
        </Link>
        <Link href="/birthday">
          <a className="item">
            <img src="/birthday.webp" alt="birthday" />
            <Typography variant="h6" className="link">
              Birthday
            </Typography>
          </a>
        </Link>
        <Link href="/samedaydelivery">
          <a className="item">
            <img src="/sddelivery.webp" alt="Same Day Delivery" />
            <Typography variant="h6" className="link">
              Same Day Delivery
            </Typography>
          </a>
        </Link>
        <style jsx>{`
          .sectionsWrapper {
            display: flex;
            align-items: center;
            flex-wrap: wrap;
            height: 100%;
          }

          .item {
            flex-grow: 1;
            text-decoration: none;
            color: #8e7329;
          },

          .link {
            color: #8e7329;
            text-align: center;
            &:hover {
              text-decoration: underline;
            }
          }
        `}</style>
      </div>
    </React.Fragment>
  );
}
